import '../css/Header.css'

class NavigationUnit{
  constructor(title, subMenu){
    this.title = title;
    this.subMenu = subMenu;
  }
}

var HeaderContent = [new NavigationUnit("Dashboard",null), new NavigationUnit("Wallets",null)];

const Header = () => {
  alert(Header.props.changeState);
  return (
    <header>
    {HeaderContent.map((unit) => (<div key={unit.title} className="navUnit">{unit.title}</div>))}
    </header>
  );
};
export default Header;
